import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';
import {Button, Col, Input, Menu, Row} from 'antd';
import Link from 'next/link'

const MiniGame = () => {
    return(
        <AppLayout>
            <Head>
                <title>MiniGame</title>
            </Head>
            <h1 className="main-title">This is my portfolio </h1>
            <section className="gameSection">
                <Link href="http://ahah12k.cafe24.com/ptp1/" className="myportf" target="_blank" rel="noreferrer noopener">
                    <a>Find your LOL character</a>
                </Link>
                <Link href="http://ahah12k.cafe24.com/ptp2/" className="myportf" target="_blank" rel="noreferrer noopener">
                    <a>Find your Breath</a>
                </Link>
            </section>
        </AppLayout>
        )
};

export default MiniGame;
